import "./Logs.css";
const Logs = () => {
  return (
    <div className="logs">
      <div className="item">
        <div className="date">
          <div className="month">4月</div>
          <div className="day">20</div>
        </div>
        <div className="content">
          <h2 className="desc">学习书法</h2>
          <div className="time">55分钟</div>
        </div>
      </div>
    </div>
  );
};
export default Logs;
